import React from 'react';
import Navigation from '../components/navigation';
import Logo from '../components/logo';

const Home = () => {
    return (
        <div>
            <Logo/>
            <h1>Acceuil</h1>
            <Navigation />
        </div>
    );
};

export default Home;
